export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},uqsoIsaM2m:{data:{id:1702,attributes:{imdbId:"tt2584384",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjU0Yzk2MzEtMjAzYy00MzY0LTg2YmItM2RkNzdkY2ZhN2JkXkEyXkFqcGdeQXVyNDg4NjY5OTQ@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.9\u002F10"},{Source:"Rotten Tomatoes",Value:"80%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:2365,attributes:{title:"Jojo Rabbit",plot:"A World War II satire that follows a lonely German boy named Jojo (Roman Griffin Davis) whose world view is turned upside down when he discovers his single mother (Scarlett Johansson) is hiding a young Jewish girl (Thomasin McKenzie) in their attic. Aided only by his idiotic imaginary friend, Adolf Hitler (Taika Waititi), Jojo must confront his blind nationalism.",slug:"jojo-rabbit"}}},books:{data:[{id:8747,attributes:{title:c,description:"The inspiration for the major film Jojo Rabbit by Taika Waititi An avid member of the Hitler Youth in 1940s Vienna, Johannes Betzler discovers his parents are hiding a Jewish girl named Elsa behind a false wall in their home. His initial horror turns to interest—then love and obsession. After his parents disappear, Johannes is the only one aware of Elsa’s existence in the house and he alone is responsible for her fate. Drawing strength from his daydreams about Hitler, Johannes plans for the end of the war and what it might mean for him and Elsa. The inspiration for the major film Jojo Rabbit by Taika Waititi, Caging Skies, sold in over twenty countries, is a work of rare power; a stylistic and storytelling triumph. Startling, blackly comic, and written in Christine Leunens’s gorgeous, muscular prose, this novel, her U.S. debut, is singular and unforgettable.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9wuFDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:true,published:"2019-08-06",publisher:"Abrams",subtitle:"A Novel"}},{id:8748,attributes:{title:c,description:"Inspiring a major film, this gripping novel examines truth and lies, and lays bare our darkest impulses. I was sure I heard steps up and down the hall in the middle of the night. Johannes is an avid member of the Hitler Youth. As the war rages on, he discovers his parents are hiding a Jewish girl called Elsa behind a false wall in their large house in Vienna. His initial horror turns to love and obsession. Both manipulating and manipulated, Johannes soon finds he is the only one aware of Elsa's existence in the house, the only one responsible for her survival. ‘It is a beautiful novel, powerful, different, and ambitious.’ — Le Monde",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V0ShDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:g,published:"2019-10-01",publisher:"Penguin Random House New Zealand Limited",subtitle:b}},{id:8749,attributes:{title:c,description:b,thumbnail:b,authors:[d],firstBook:g,published:"2019-01-01",publisher:b,subtitle:"BOOK GROUP"}}]}}},meta:{}}},prerenderedAt:1681703553839}}("movie","","Caging Skies","Christine Leunens","series",1,null))